using System;
using System.Collections.Generic;
using System.Linq;
using System.Threading.Tasks;

namespace RestaurantLaPashtetDeliverySystem.Models
{
    public class ExampleFoodRepository : IFoodRepository
    {
        private readonly IClassificationRepository _classificationRepository = new ExampleClassificationRepository();

        public IEnumerable<Food> AllFood =>
            new List<Food>
            {
                new Food {FoodId = 1, Name="Salmon tartar", Price=5700M, ShortDescription="Yeah, it is tartar!", LongDescription="Salmon tartare is prepared with fresh raw salmon and seasonings. It is commonly spread on a cracker or bread and eaten as an appetizer.", Classification = _classificationRepository.AllClassifications.ToList()[0],ImageUrl="https://media.foodnetwork.ca/recipetracker/dmm/S/A/Salmon_Tartar_with_Salmon_Kelp_Caviar_001.jpg", InStock=true, PopularFood=true},
                new Food {FoodId = 2, Name="Olivier Salad", Price=1400M, ShortDescription="Olivier salad is a Russian salad with variable ingredients, but it is typically made with chopped vegetables, meat, and mayonnaise.", LongDescription="Olivier Salad usually has peas, potatoes, carrots, onions, meat, pickles, and eggs all mixed with mayo. The meat used is either bologna, chicken or ham. The potatoes, eggs and carrots are cooked by boiling with skin on in water, then peeled.", Classification = _classificationRepository.AllClassifications.ToList()[1],ImageUrl="data:image/jpeg;base64,", InStock=true, PopularFood=false},
                new Food {FoodId = 3, Name="Gazpacho Cold Soup", Price=1500M, ShortDescription="Gazpacho or Andalusian gazpacho is a cold soup made of raw, blended vegetables.", LongDescription="Gazpacho is a cool, refreshing, and flavorful soup that is the perfect starter to any meal on a hot summer day. It also makes the perfect healthy snack. This cold soup originates in southern Spain, a hot and dry region called Andalusia. It's as simple and authentic as it gets, resulting in a silky smooth and delicious cold gazpacho. During the hot weather, do what the Spaniards do and make a batch of gazpacho and keep it in a glass pitcher in the refrigerator for whenever you need a cool drink.", Classification = _classificationRepository.AllClassifications.ToList()[2],ImageUrl="data:image/jpeg;base64,", InStock=true, PopularFood=true}
          
            };

        public IEnumerable<Food> PopularFood { get; }

        public Food GetFoodById(int foodId)
        {
            return AllFood.FirstOrDefault(p => p.FoodId == foodId);
        }

        public Food GetFoodByName(string name)
        {
            return AllFood.FirstOrDefault(p => p.Name == name);
        }

    }
}
